  CONSTRAINT `fk_dev_areaid` FOREIGN KEY (`area_id`) REFERENCES `tbl_area` (`area_id`) ON DELETE SET NULL ON UPDATE CASCADE,
  CONSTRAINT `fk_dev_mfrcode` FOREIGN KEY (`mfr_code`) REFERENCES `tbl_manufacturer` (`mfr_code`) ON DELETE SET NULL ON UPDATE CASCADE,
  CONSTRAINT `fk_dev_optid` FOREIGN KEY (`opt_user`) REFERENCES `tbl_user` (`user_id`) ON DELETE SET NULL ON UPDATE CASCADE,
  CONSTRAINT `fk_dev_principal` FOREIGN KEY (`device_principal`) REFERENCES `tbl_user` (`user_id`) ON DELETE SET NULL ON UPDATE CASCADE,
  CONSTRAINT `fk_dev_projectid` FOREIGN KEY (`project_id`) REFERENCES `tbl_device_project` (`project_id`) ON DELETE SET NULL ON UPDATE CASCADE,
  CONSTRAINT `fk_dev_statuscode` FOREIGN KEY (`status_code`) REFERENCES `tbl_status` (`status_code`) ON DELETE SET NULL ON UPDATE CASCADE,
  CONSTRAINT `fk_dev_unit` FOREIGN KEY (`oversight_unit`) REFERENCES `tbl_oranization` (`org_id`) ON DELETE SET NULL ON UPDATE CASCADE
