-- ----------------------------
-- Procedure structure for PerDayStaStatisticsOutput
-- ----------------------------
DROP PROCEDURE IF EXISTS `PerDayStaStatisticsOutput`;
delimiter ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `PerDayStaStatisticsOutput`(IN `dboldname` varchar(100),IN `devcode` varchar(100),IN `thingcode` varchar(100),IN `starttime` datetime,IN `endtime` datetime,IN `rowindex` int,IN `rowcount` int,OUT `allcount` int)
BEGIN
	#创建临时表
	CREATE TEMPORARY TABLE IF NOT EXISTS tbm_perday
	(
		devcode VARCHAR(100) NOT NULL,
 		devname VARCHAR(200) NOT NULL,
		thingcode VARCHAR(100) NOT NULL,
		thingname VARCHAR(200) NOT NULL,
		monitorvalue DOUBLE(20,3) NULL,
		zsmonitorvalue DOUBLE(20,3) NULL,
		frequetime VARCHAR(20) NOT NULL
	) engine = MEMORY;

	TRUNCATE TABLE tbm_perday;

	#设置参数
	SET @fre = 1;
/*
	SET @totalfre = @fre;
	SET @sqlst = CONCAT('SET @tempstarttime = (SELECT CASE WHEN TIMESTAMPDIFF(SECOND,MIN(rtd_time),''',starttime,''')>=0 THEN ''',starttime,''' ELSE MIN(rtd_time) END FROM ',devcode,' AS dev WHERE device_code = ''',devcode,''' AND thing_code = ''',thingcode,''');');
	PREPARE stmt_st FROM @sqlst;
	EXECUTE stmt_st;
	DEALLOCATE PREPARE stmt_st;
	SET @sqlet = CONCAT('SET @endtime = (SELECT CASE WHEN TIMESTAMPDIFF(SECOND,MAX(rtd_time),''',endtime,''')>=0 THEN MAX(rtd_time) ELSE ''',endtime,''' END FROM ',devcode,' AS dev WHERE device_code = ''',devcode,''' AND thing_code = ''',thingcode,''');');
	PREPARE stmt_et FROM @sqlet;
	EXECUTE stmt_et;
	DEALLOCATE PREPARE stmt_et;
*/
	SET @starttime = starttime;
	SET @endtime = DATE_ADD(endtime,INTERVAL @fre DAY);
	#按照时间频率统计
/*
	WHILE TIMESTAMPDIFF(DAY,@tempstarttime,@endtime)>=0 DO
		SET @sqlsel = CONCAT('
			SET @count = (SELECT COUNT(0)
										FROM ',devcode,' AS tms INNER JOIN tbl_device AS tdv ON tms.device_code = tdv.device_code
										WHERE tms.device_code = ''',devcode,''' AND tms.thing_code = ''',thingcode,'''
										AND tms.update_type = ''2011''
										AND YEAR(tms.rtd_time) = YEAR(''',@tempstarttime,''')
										AND MONTH(tms.rtd_time) = MONTH(''',@tempstarttime,''')
										AND DAY(tms.rtd_time) = DAY(''',@tempstarttime,''')
										AND TIMESTAMPDIFF(DAY,tms.rtd_time,''',@endtime,''')>=0);
		');
		PREPARE stmt_sel FROM @sqlsel;
		EXECUTE stmt_sel;
		DEALLOCATE PREPARE stmt_sel;
		IF @count >0 THEN
			SET @sqlmain = CONCAT('
				SELECT tdv.device_code,tdv.device_name,tms.thing_code,tmo.thing_name,AVG(tms.thing_avg) AS thing_avg,CONCAT(CAST(DATE(''',@tempstarttime,''') AS CHAR),''日'')
				FROM ',devcode,' AS tms INNER JOIN tbl_device AS tdv ON tms.device_code = tdv.device_code
				INNER JOIN tbl_monitor tmo ON tms.thing_code = tmo.thing_code
				WHERE tms.device_code = ''',devcode,''' AND tms.thing_code = ''',thingcode,'''
				AND tms.update_type = ''2011''
				AND YEAR(tms.rtd_time) = YEAR(''',@tempstarttime,''')
				AND MONTH(tms.rtd_time) = MONTH(''',@tempstarttime,''')
				AND DAY(tms.rtd_time) = DAY(''',@tempstarttime,''')
				AND TIMESTAMPDIFF(DAY,tms.rtd_time,''',@endtime,''')>=0;
			');
			PREPARE stmt_main FROM @sqlmain;
			EXECUTE stmt_main;
			DEALLOCATE PREPARE stmt_main;
		END IF;
		SET @tempstarttime = DATE_ADD(@tempstarttime,INTERVAL @totalfre DAY);

	END WHILE;
*/
	SET @sqlmain = CONCAT('
		SELECT device_code,device_name,thing_code,thing_name,AVG(thing_rtd) AS thing_avg,AVG(thing_zsrtd) AS thing_zsavg,concattime
		FROM 
		(
			SELECT tdv.device_code,tdv.device_name,tms.thing_code,tmo.thing_name,tms.thing_rtd,tms.thing_zsrtd,CONCAT(CAST(DATE(tms.rtd_time) AS CHAR),''日'') AS concattime
			FROM ',devcode,' AS tms INNER JOIN tbl_device AS tdv ON tms.device_code = tdv.device_code
			INNER JOIN tbl_monitor tmo ON tms.thing_code = tmo.thing_code
			WHERE tms.device_code = ''',devcode,''' AND tms.thing_code = ''',thingcode,'''
			AND tms.update_type = ''2011''
			AND TIMESTAMPDIFF(SECOND,''',@starttime,''',tms.rtd_time)>=0
			AND TIMESTAMPDIFF(SECOND,tms.rtd_time,''',@endtime,''')>0');
	IF dboldname IS NOT NULL AND dboldname <> '' THEN
		SET @sqlmain = CONCAT(@sqlmain,' UNION SELECT tdv.device_code,tdv.device_name,tms.thing_code,tmo.thing_name,tms.thing_rtd,tms.thing_zsrtd,CONCAT(CAST(DATE(tms.rtd_time) AS CHAR),''日'') AS concattime
			FROM ',dboldname,'.',devcode,' AS tms INNER JOIN tbl_device AS tdv ON tms.device_code = tdv.device_code
			INNER JOIN tbl_monitor tmo ON tms.thing_code = tmo.thing_code
			WHERE tms.device_code = ''',devcode,''' AND tms.thing_code = ''',thingcode,'''
			AND tms.update_type = ''2011''
			AND TIMESTAMPDIFF(SECOND,''',@starttime,''',tms.rtd_time)>=0
			AND TIMESTAMPDIFF(SECOND,tms.rtd_time,''',@endtime,''')>0');
	END IF;
	SET @sqlmain = CONCAT(@sqlmain,') temp GROUP BY temp.device_code,temp.device_name,temp.thing_code,temp.thing_name,temp.concattime;');
	PREPARE stmt_main FROM @sqlmain;
	EXECUTE stmt_main;
	DEALLOCATE PREPARE stmt_main;

	#返回结果
	SET allcount = (SELECT COUNT(0) FROM tbm_perday);
	IF (rowindex = -1 OR rowcount = -1) THEN
		SELECT devcode,devname,thingcode,thingname,AVG(monitorvalue) AS monitorvalue,AVG(zsmonitorvalue) AS zsmonitorvalue,frequetime 
		FROM tbm_perday
		GROUP BY devcode,devname,thingcode,thingname,frequetime;
	ELSE
		SELECT devcode,devname,thingcode,thingname,AVG(monitorvalue) AS monitorvalue,AVG(zsmonitorvalue) AS zsmonitorvalue,frequetime 
		FROM tbm_perday
		GROUP BY devcode,devname,thingcode,thingname,frequetime
		LIMIT rowindex,rowcount;
	END IF;
	TRUNCATE TABLE tbm_perday;
	#DROP TABLE tbm_perday;
END
;;
delimiter ;

