	SET @tempstarttime = starttime;
*/
	SET @starttime = starttime;
	SET @endtime = endtime;

	#按照时间频率统计
/*
	outer_label:WHILE TIMESTAMPDIFF(QUARTER,@tempstarttime,@endtime)>0 DO
		SET @sqlsel = CONCAT('
			SET @count = (SELECT COUNT(0)
										FROM ',devcode,' AS tms INNER JOIN tbl_device AS tdv ON tms.device_code = tdv.device_code
										WHERE tms.device_code = ''',devcode,''' AND tms.thing_code = ''',thingcode,'''
										AND tms.update_type = ''2031''
										AND YEAR(tms.begin_time) = YEAR(''',@tempstarttime,''')
										AND QUARTER(tms.begin_time) = QUARTER(''',@tempstarttime,'''));
		');
		PREPARE stmt_sel FROM @sqlsel;
		EXECUTE stmt_sel;
		DEALLOCATE PREPARE stmt_sel;
		IF @count>0 THEN
			SET @sqlmain = CONCAT('
				SELECT tdv.device_code,tdv.device_name,tms.thing_code,tmo.thing_name,AVG(tms.thing_avg) AS thing_avg,CONCAT(YEAR(''',@tempstarttime,'''),''-'',LPAD(QUARTER(''',@tempstarttime,'''),2,0),''季'')
				FROM ',devcode,' AS tms INNER JOIN tbl_device AS tdv ON tms.device_code = tdv.device_code
				INNER JOIN tbl_monitor tmo ON tms.thing_code = tmo.thing_code
				WHERE tms.device_code = ''',devcode,''' AND tms.thing_code = ''',thingcode,'''
				AND tms.update_type = ''2031''
				AND YEAR(tms.begin_time) = YEAR(''',@tempstarttime,''')
				AND QUARTER(tms.begin_time) = QUARTER(''',@tempstarttime,''');
			');
			PREPARE stmt_main FROM @sqlmain;
			EXECUTE stmt_main;
			DEALLOCATE PREPARE stmt_main;
			END IF;
			#SET @insertcount = (SELECT COUNT(0) FROM tbm_perhour);
			#IF (rowcount <> -1 AND @insertcount >= (rowindex+1)*rowcount) THEN
				#LEAVE outer_label;
			#ELSE
				SET @tempstarttime = DATE_ADD(@tempstarttime,INTERVAL @totalfre QUARTER);
			#END IF;

	END WHILE;
*/
	SET @sqlmain = CONCAT('
		SELECT device_code,device_name,thing_code,thing_name,AVG(thing_avg) AS thing_avg,AVG(thing_zsavg) AS thing_zsavg,concattime
		FROM 
		(
			SELECT tdv.device_code,tdv.device_name,tms.thing_code,tmo.thing_name,tms.thing_avg,tms.thing_zsavg,CONCAT(YEAR(tms.begin_time),''-'',LPAD(QUARTER(tms.begin_time),2,0),''季'') AS concattime
			FROM ',devcode,' AS tms INNER JOIN tbl_device AS tdv ON tms.device_code = tdv.device_code
			INNER JOIN tbl_monitor tmo ON tms.thing_code = tmo.thing_code
			WHERE tms.device_code = ''',devcode,''' AND tms.thing_code = ''',thingcode,'''
			AND tms.update_type = ''2031''
			AND TIMESTAMPDIFF(SECOND,''',@starttime,''',tms.begin_time)>=0
			AND TIMESTAMPDIFF(SECOND,tms.begin_time,''',@endtime,''')>0');
	IF dboldname IS NOT NULL AND dboldname <> '' THEN
		SET @sqlmain = CONCAT(@sqlmain,' UNION SELECT tdv.device_code,tdv.device_name,tms.thing_code,tmo.thing_name,tms.thing_avg,tms.thing_zsavg,CONCAT(YEAR(tms.begin_time),''-'',LPAD(QUARTER(tms.begin_time),2,0),''季'') AS concattime
			FROM ',dboldname,'.',devcode,' AS tms INNER JOIN tbl_device AS tdv ON tms.device_code = tdv.device_code
			INNER JOIN tbl_monitor tmo ON tms.thing_code = tmo.thing_code
			WHERE tms.device_code = ''',devcode,''' AND tms.thing_code = ''',thingcode,'''
			AND tms.update_type = ''2031''
			AND TIMESTAMPDIFF(SECOND,''',@starttime,''',tms.begin_time)>=0
			AND TIMESTAMPDIFF(SECOND,tms.begin_time,''',@endtime,''')>0');
	END IF;
	SET @sqlmain = CONCAT(@sqlmain,') temp GROUP BY temp.device_code,temp.device_name,temp.thing_code,temp.thing_name,temp.concattime;');
	PREPARE stmt_main FROM @sqlmain;
	EXECUTE stmt_main;
	DEALLOCATE PREPARE stmt_main;

	#返回结果
	SET allcount = (SELECT COUNT(0) FROM tbm_perquarter);
	IF (rowindex = -1 OR rowcount = -1) THEN
		SELECT devcode,devname,thingcode,thingname,AVG(monitorvalue) AS monitorvalue,AVG(zsmonitorvalue) AS zsmonitorvalue,frequetime 
		FROM tbm_perquarter
		GROUP BY devcode,devname,thingcode,thingname,frequetime;
	ELSE
		SELECT devcode,devname,thingcode,thingname,AVG(monitorvalue) AS monitorvalue,AVG(zsmonitorvalue) AS zsmonitorvalue,frequetime 
		FROM tbm_perquarter
		GROUP BY devcode,devname,thingcode,thingname,frequetime
		LIMIT rowindex,rowcount;
	END IF;
	TRUNCATE TABLE tbm_perquarter;
	#DROP TABLE tbm_perquarter;
END
;;
delimiter ;

