-- ----------------------------
-- Procedure structure for prAutoCreateDevice
-- ----------------------------
DROP PROCEDURE IF EXISTS `prAutoCreateDevice`;
delimiter ;;
CREATE DEFINER=`root`@`%` PROCEDURE `prAutoCreateDevice`()
BEGIN
	-- 获取系统时间
	DECLARE i INT;
	DECLARE _devicecode VARCHAR(100);
	DECLARE _devicemn VARCHAR(100);
	DECLARE _devicename VARCHAR(100);
	DECLARE _x DOUBLE(11,6);
	DECLARE _y DOUBLE(11,6);
	SET i = 500;	
	WHILE i<10000 DO
		SET _devicecode = CONCAT('testdevice',i);
		SET _devicemn = CONCAT('1234567891',LPAD(HEX(CONVERT(i,SIGNED)),4,0));
		SET _devicename = CONCAT('环保测试设备',i);
		SET _x = 117.217168+(i*0.000001);
		SET _y = 39.152168+(i*0.000001);
		-- 创建表

		SET @sqlcreate = CONCAT('CREATE TABLE IF NOT EXISTS ',_devicecode,' (
									storage_id bigint(20) NOT NULL AUTO_INCREMENT COMMENT ''递增id'',
									device_code varchar(100) NOT NULL COMMENT ''设备编码'',
									thing_code varchar(100) NOT NULL COMMENT ''监测物编号'',
									thing_value double(14,3) DEFAULT NULL COMMENT ''监测物上报实时值数据'',
									thing_avg double(14,3) DEFAULT NULL COMMENT ''监测物上报平均值数据'',
									thing_max double(14,3) DEFAULT NULL COMMENT ''监测物上报最大值数据'',
									thing_min double(14,3) DEFAULT NULL COMMENT ''监测物上报最大值数据'',
									thing_flag varchar(50) DEFAULT NULL COMMENT ''监测物上报标识'',
									update_type int(11) NOT NULL COMMENT ''监测物上报类型'',
									update_time datetime DEFAULT NULL COMMENT ''监测物上报系统时间'',
									rld_time datetime DEFAULT NULL COMMENT ''监测物上报实时时间'',
									begin_time datetime DEFAULT NULL COMMENT ''监测物上报开始采集时间'',
									end_time datetime DEFAULT NULL COMMENT ''监测物上报结束采集时间'',
									PRIMARY KEY (storage_id,update_type),
									KEY un_',_devicecode,'_thingcode (thing_code) USING BTREE,
									KEY un_',_devicecode,'_updatetime (`update_time`) USING BTREE
									)ENGINE=InnoDB AUTO_INCREMENT=1 DEFAULT CHARSET=utf8
									PARTITION BY LIST(update_type) (
											PARTITION mRld VALUES IN (2011),
											PARTITION mDay VALUES IN (2031),
											PARTITION mMin VALUES IN (2051),
											PARTITION mHour VALUES IN (2061)
									);');
				PREPARE stmt_create FROM @sqlcreate;				
				EXECUTE stmt_create;
				DEALLOCATE PREPARE stmt_create;
		-- 插入数据
			device_code
		)
		VALUES
		(
			_devicecode
		);

		device_mn,
		device_name,
		device_ip,		
		device_port,		
		device_pwd,
		device_x,
		device_y,
		system_version,
		inspect_time,		
		mfr_code,
		area_id,		
		status_code,		
		opt_user,
		build_firm,
		device_principal,
		oversight_unit,
		device_address,
		device_km
		)
		SELECT 
		_devicecode,
		_devicemn,
		_devicename,
		device_ip,		
		device_port,		
		device_pwd,
		_x,
		_y,
		system_version,
		inspect_time,		
		mfr_code,
		area_id,		
		status_code,		
		opt_user,
		build_firm,
		device_principal,
		oversight_unit,
		device_address,
		device_km
		FROM tbl_device
		WHERE device_code='testdevice1';
		SET i=i+1;
	END WHILE;
END
;;
delimiter ;

