-- ----------------------------
-- Procedure structure for prDelStorageData
-- ----------------------------
DROP PROCEDURE IF EXISTS `prDelStorageData`;
delimiter ;;
CREATE DEFINER=`root`@`%` PROCEDURE `prDelStorageData`()
BEGIN
	-- 获取系统时间
	DECLARE nowtime DATETIME default NOW();
	#遍历标识
	DECLARE devicecode VARCHAR(100);
  -- 遍历数据结束标志
  DECLARE done INT DEFAULT FALSE;

	-- 删除一年以上监测数据
	DECLARE _devicecode CURSOR FOR SELECT device_code FROM tbl_device;
  -- 将结束标志绑定到游标
	#DECLARE CONTINUE HANDLER FOR SQLEXCEPTION SET done = FALSE;
	DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;
	OPEN _devicecode;
		FETCH NEXT FROM _devicecode INTO devicecode;
		REPEAT
			IF done = FALSE THEN
				SET @sqldel = CONCAT('DELETE FROM ',devicecode,' WHERE TIMESTAMPDIFF(SECOND,update_time,''',nowtime,''')>=31536000');
				PREPARE stmt_del FROM @sqldel;				
				EXECUTE stmt_del;
				DEALLOCATE PREPARE stmt_del;
			END IF;
				FETCH NEXT FROM _devicecode INTO devicecode;		
		UNTIL done END REPEAT;
	CLOSE _devicecode;

	-- 删除一年以上已解决的报警
	DELETE FROM tbl_alarm WHERE TIMESTAMPDIFF(SECOND,alarm_time,nowtime)>=31536000 AND alarm_status = '2';

	-- 删除一年以上天气信息
	DELETE FROM tbl_weather WHERE TIMESTAMPDIFF(SECOND,opt_time,nowtime)>=31536000;

	-- 删除一年以上计划任务
	DELETE FROM tbl_comm_main WHERE TIMESTAMPDIFF(SECOND,opt_time,nowtime)>=31536000;

END
;;
delimiter ;

-- ----------------------------
-- Procedure structure for prStatisticsDeviceDay
-- ----------------------------
DROP PROCEDURE IF EXISTS `prStatisticsDeviceDay`;
delimiter ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `prStatisticsDeviceDay`()
BEGIN
	#遍历标识
	DECLARE devicecode VARCHAR(100);
  -- 遍历数据结束标志
  DECLARE done INT DEFAULT FALSE;

	DECLARE _device CURSOR FOR
		(SELECT DISTINCT td.device_code FROM tbl_device td 
				INNER JOIN tbl_device_time tdt ON td.device_code = tdt.device_code 
				WHERE td.sta_day=1
					AND TIMESTAMPDIFF(SECOND,
														(SELECT sys_value FROM tbl_sys_flag WHERE sys_flag_code='stadayupd' LIMIT 0,1),
														tdt.update_time)>=0);

  -- 将结束标志绑定到游标
	DECLARE CONTINUE HANDLER FOR SQLEXCEPTION SET done = FALSE;
  DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;

	-- 设置时间
	SET @systime = (SELECT sys_value FROM tbl_sys_flag WHERE sys_flag_code='stadayupd' LIMIT 0,1);
	SET @begintime = CONCAT(DATE(@systime),' ','00:00:00');
	SET @endtime = DATE_ADD(@begintime,INTERVAL 1 DAY);
	SET @nowtime = NOW();

	OPEN _device;
		FETCH NEXT FROM _device INTO devicecode;
		REPEAT
			SET @existsql = CONCAT('SET @exist = (SELECT COUNT(0) FROM ',devicecode,
														 ' tms WHERE tms.update_type=''2031''
															 AND DATE(tms.begin_time) = DATE(''',@begintime,'''));');
			PREPARE stmt_exist FROM @existsql;
			EXECUTE stmt_exist;
			DEALLOCATE PREPARE stmt_exist;
			IF done = FAlSE AND @exist=0 THEN
				SET @insertsql = CONCAT('INSERT DELAYED INTO ',devicecode,' (
																					device_code,
																					thing_code,
																					thing_avg,
																					thing_max,
																					thing_min,
																					update_type,
																					update_time,
																					begin_time,
																					end_time,
																					thing_zsavg,
																					thing_zsmax,
																					thing_zsmin,
																					thing_cou
																				)
																				SELECT
																					tms.device_code,
																					tms.thing_code,
																					AVG(tms.thing_rtd) AS thing_avg,
																					MAX(tms.thing_rtd) AS thing_max,
																					MIN(tms.thing_rtd) AS thing_min,
																					''2031'' AS update_type,
																					''',@nowtime,''' AS update_time,
																					''',@begintime,''' AS begin_time,
																					''',@endtime,''' AS end_time,
																					AVG(tms.thing_zsrtd) AS thing_zsavg,
																					MAX(tms.thing_zsrtd) AS thing_zsmax,
																					MIN(tms.thing_zsrtd) AS thing_zsmin,
																					SUM(tms.thing_cou) AS thing_cou
																				FROM
																					',devicecode,' tms
																				WHERE
																				tms.update_type = ''',2011,'''
																				AND	DATE(tms.rtd_time) = DATE(''',@begintime,''')
																				GROUP BY tms.thing_code');
				PREPARE stmt_insert FROM @insertsql;
				EXECUTE stmt_insert;
				DEALLOCATE PREPARE stmt_insert;
			END IF;
		FETCH NEXT FROM _device INTO devicecode;
		UNTIL done END REPEAT;
	CLOSE _device;

	IF TIMESTAMPDIFF(SECOND,@endtime,@nowtime)>0 THEN
		UPDATE tbl_sys_flag SET sys_value = @endtime,opt_time = @nowtime WHERE sys_flag_code='stadayupd';
	END IF;

END
;;
delimiter ;

