																				tms.update_type = ''',2011,'''
																				AND	DATE(tms.rtd_time) = DATE(''',@begintime,''')
																				AND HOUR(tms.rtd_time) = HOUR(''',@begintime,''')
																				AND FLOOR(MINUTE(tms.rtd_time)/10) =  FLOOR(MINUTE(''',@begintime,''')/10)
																				GROUP BY tms.thing_code');
				PREPARE stmt_insert FROM @insertsql;
				EXECUTE stmt_insert;
				DEALLOCATE PREPARE stmt_insert;
			END IF;
		FETCH NEXT FROM _device INTO devicecode;
		UNTIL done END REPEAT;
	CLOSE _device;

	IF TIMESTAMPDIFF(SECOND,@endtime,@nowtime)>0 THEN
		UPDATE tbl_sys_flag SET sys_value = @endtime,opt_time = @nowtime WHERE sys_flag_code='staminuteupd';
	END IF;
	

END
;;
delimiter ;

-- ----------------------------
-- Procedure structure for prStatisticsStandardFlowDay
-- ----------------------------
DROP PROCEDURE IF EXISTS `prStatisticsStandardFlowDay`;
delimiter ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `prStatisticsStandardFlowDay`()
BEGIN
	#遍历标识
	DECLARE devicecode VARCHAR(100);
  -- 遍历数据结束标志
  DECLARE done INT DEFAULT FALSE;

	DECLARE _device CURSOR FOR
		(SELECT DISTINCT td.device_code FROM tbl_device td 
				INNER JOIN tbl_device_time tdt ON td.device_code = tdt.device_code 
				WHERE td.sta_flow=1
				AND TIMESTAMPDIFF(SECOND,
														(SELECT sys_value FROM tbl_sys_flag WHERE sys_flag_code='stadayflow' LIMIT 0,1),
														tdt.update_time)>=0);

  -- 将结束标志绑定到游标
	DECLARE CONTINUE HANDLER FOR SQLEXCEPTION SET done = FALSE;
  DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;

	-- 设置时间
	SET @systime = (SELECT sys_value FROM tbl_sys_flag WHERE sys_flag_code='stadayflow' LIMIT 0,1);
	SET @begintime = CONCAT(DATE(@systime),' ','00:00:00');
	SET @endtime = DATE_ADD(@begintime,INTERVAL 1 DAY);
	SET @nowtime = NOW();

	OPEN _device;
		FETCH NEXT FROM _device INTO devicecode;
		REPEAT
			SET @existsql = CONCAT('SET @exist = (SELECT COUNT(0) FROM ',devicecode,
														 ' tms WHERE tms.update_type=''2031''
															 AND DATE(tms.begin_time) = DATE(''',@begintime,''')
															 AND tms.thing_code = ''a00000'');');
			PREPARE stmt_exist FROM @existsql;
			EXECUTE stmt_exist;
			DEALLOCATE PREPARE stmt_exist;
			SET @hourexistsql = CONCAT('SET @hour_exist = (SELECT COUNT(0) FROM ',devicecode,
														 ' tms WHERE tms.update_type=''2061''
															 AND DATE(tms.begin_time) = DATE(''',@begintime,''')
															 AND tms.thing_code = ''a00000'');');
			PREPARE stmt_hour_exist FROM @hourexistsql;
			EXECUTE stmt_hour_exist;
			DEALLOCATE PREPARE stmt_hour_exist;
			IF done = FAlSE AND @exist=0 AND @hour_exist>0 THEN
				SET @insertsql = CONCAT('INSERT INTO ',devicecode,' (
																					device_code,
																					thing_code,
																					thing_avg,
																					thing_max,
																					thing_min,
																					update_type,
																					update_time,
																					begin_time,
																					end_time,
																					thing_zsavg,
																					thing_zsmax,
																					thing_zsmin,
																					thing_cou
																				)
																				SELECT
																					''',devicecode,''',
																					''a00000'',
																					SUM(tms.thing_avg) AS thing_avg,
																					SUM(tms.thing_avg) AS thing_max,
																					SUM(tms.thing_avg) AS thing_min,
																					''2031'' AS update_type,
																					''',@nowtime,''' AS update_time,
																					''',@begintime,''' AS begin_time,
																					''',@endtime,''' AS end_time,
																					SUM(tms.thing_zsavg) AS thing_zsavg,
																					SUM(tms.thing_zsavg) AS thing_zsmax,
																					SUM(tms.thing_zsavg) AS thing_zsmin,
																					SUM(tms.thing_cou) AS thing_cou
																				FROM
																					',devicecode,' tms
																				WHERE
																				tms.update_type = ''',2061,'''
																				AND tms.thing_code = ''a00000''
																				AND	DATE(tms.begin_time) = DATE(''',@begintime,''')');
				-- SELECT @insertsql;
				PREPARE stmt_insert FROM @insertsql;
				EXECUTE stmt_insert;
				DEALLOCATE PREPARE stmt_insert;
			END IF;
		FETCH NEXT FROM _device INTO devicecode;
		UNTIL done END REPEAT;
		IF TIMESTAMPDIFF(SECOND,@endtime,@nowtime)>0 THEN
			UPDATE tbl_sys_flag SET sys_value = @endtime,opt_time = @nowtime WHERE sys_flag_code='stadayflow';
		END IF;
	CLOSE _device;
	

END
;;
delimiter ;

-- ----------------------------
-- Procedure structure for prStatisticsStandardFlowHour
-- ----------------------------
DROP PROCEDURE IF EXISTS `prStatisticsStandardFlowHour`;
delimiter ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `prStatisticsStandardFlowHour`()
BEGIN
	#遍历标识
	DECLARE devicecode VARCHAR(100);
  -- 遍历数据结束标志
  DECLARE done INT DEFAULT FALSE;

	DECLARE _device CURSOR FOR
		(SELECT DISTINCT td.device_code FROM tbl_device td 
				INNER JOIN tbl_device_time tdt ON td.device_code = tdt.device_code 
				WHERE td.sta_flow=1
				AND TIMESTAMPDIFF(SECOND,
														(SELECT sys_value FROM tbl_sys_flag WHERE sys_flag_code='stahourflow' LIMIT 0,1),
														tdt.update_time)>=0);

  -- 将结束标志绑定到游标
	DECLARE CONTINUE HANDLER FOR SQLEXCEPTION SET done = FALSE;-- FALSE
  DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;-- TRUE

	-- 设置时间
	SET @systime = (SELECT sys_value FROM tbl_sys_flag WHERE sys_flag_code='stahourflow' LIMIT 0,1);
	SET @begintime = CONCAT(DATE(@systime),' ',LPAD(HOUR(@systime),2,0),':00:00');
	SET @endtime = DATE_ADD(@begintime,INTERVAL 1 HOUR);
	SET @nowtime = NOW();
	OPEN _device;
		FETCH NEXT FROM _device INTO devicecode;
		REPEAT
			SET @existsql = CONCAT('SET @exist = (SELECT COUNT(0) FROM ',devicecode,
														 ' tms WHERE tms.update_type=''2061''
															 AND DATE(tms.begin_time) = DATE(''',@begintime,''')
															 AND HOUR(tms.begin_time) = HOUR(''',@begintime,''')
															 AND tms.thing_code = ''a00000'');');
			PREPARE stmt_exist FROM @existsql;
			EXECUTE stmt_exist;
			DEALLOCATE PREPARE stmt_exist;
			IF done = FAlSE AND @exist=0 THEN
				-- 烟气温度
				SET @temperaturesql = CONCAT('SET @temperature = (SELECT thing_avg FROM ',devicecode,
							 ' tms WHERE tms.update_type=''2061''
								 AND DATE(tms.begin_time) = DATE(''',@begintime,''')
								 AND HOUR(tms.begin_time) = HOUR(''',@begintime,''')
								 AND tms.thing_code = ''a01012'');');
				PREPARE stmt_temperature FROM @temperaturesql;
				EXECUTE stmt_temperature;
				DEALLOCATE PREPARE stmt_temperature;
				IF @temperature IS NULL THEN
					SET @temperature = 0;-- 查询不到设置为0
				END IF;
				-- SELECT @temperature;
				-- 烟气湿度
				SET @humiditysql = CONCAT('SET @humidity = (SELECT thing_avg FROM ',devicecode,
							 ' tms WHERE tms.update_type=''2061''
								 AND DATE(tms.begin_time) = DATE(''',@begintime,''')
								 AND HOUR(tms.begin_time) = HOUR(''',@begintime,''')
								 AND tms.thing_code = ''a01014'');');
				PREPARE stmt_humidity FROM @humiditysql;
				EXECUTE stmt_humidity;
				DEALLOCATE PREPARE stmt_humidity;
				IF @humidity IS NULL THEN
					SET @humidity = 0;-- 查询不到设置为0
				END IF;
				-- SELECT @humidity;
				-- 烟气压力
				SET @pressuresql = CONCAT('SET @pressure = (SELECT thing_avg FROM ',devicecode,
											 ' tms WHERE tms.update_type=''2061''
												 AND DATE(tms.begin_time) = DATE(''',@begintime,''')
												 AND HOUR(tms.begin_time) = HOUR(''',@begintime,''')
												 AND tms.thing_code = ''a01013'');');
				PREPARE stmt_pressure FROM @pressuresql;
				EXECUTE stmt_pressure;
				DEALLOCATE PREPARE stmt_flue_area;
				IF @pressure IS NULL THEN
					SET @pressure = 0;-- 查询不到设置为0
				END IF;
				-- SELECT @pressure;
				-- 工况烟气流量
				SET @workflowsql = CONCAT('SET @workflow = (SELECT thing_avg FROM ',devicecode,
											 ' tms WHERE tms.update_type=''2061''
												 AND DATE(tms.begin_time) = DATE(''',@begintime,''')
												 AND HOUR(tms.begin_time) = HOUR(''',@begintime,''')
												 AND tms.thing_code = ''a00000'');');
				PREPARE stmt_workflow FROM @workflowsql;
				EXECUTE stmt_workflow;
				DEALLOCATE PREPARE stmt_workflow;
				-- SELECT @workflow;
				IF @workflow IS NULL THEN
					-- 烟气流速
					SET @speedsql = CONCAT('SET @speed = (SELECT thing_avg FROM ',devicecode,
												 ' tms WHERE tms.update_type=''2061''
													 AND DATE(tms.begin_time) = DATE(''',@begintime,''')
													 AND HOUR(tms.begin_time) = HOUR(''',@begintime,''')
													 AND tms.thing_code = ''a01011'');');
					PREPARE stmt_speed FROM @speedsql;
					EXECUTE stmt_speed;
					DEALLOCATE PREPARE stmt_speed;
					IF @speed IS NULL THEN
						SET @speed = 0;-- 查询不到设置为0
					END IF;
					-- SELECT @speed;
					-- 截面积
					SET @flueareasql = CONCAT('SET @fluearea = (SELECT thing_avg FROM ',devicecode,
												 ' tms WHERE tms.update_type=''2061''
													 AND DATE(tms.begin_time) = DATE(''',@begintime,''')
													 AND HOUR(tms.begin_time) = HOUR(''',@begintime,''')
													 AND tms.thing_code = ''a01016'');');
					PREPARE stmt_flue_area FROM @flueareasql;
					EXECUTE stmt_flue_area;
					DEALLOCATE PREPARE stmt_flue_area;
					IF @fluearea IS NULL OR @flueArea = '' THEN
						SET @pipearea = (SELECT pipe_area FROM tbl_device WHERE device_code = devicecode LIMIT 0,1);
						IF @pipearea IS NULL THEN
							SET @pipearea = 0;-- 查询不到设置为0
						END IF;
						SET @fluearea = @pipearea;
					END IF;
					-- SELECT @fluearea;
					-- 工况烟气流量
					SET @workflow = @fluearea*@speed*3600; -- (m3/h)
				END IF;
				-- SELECT @workflow;
				-- 标态烟气流量
				SET @standardflow = (@workflow*(273/(273+@temperature))*((101325+@pressure*1000)/101325)*(1-@humidity/100));
				-- SELECT @standardflow;
				-- 追加标态流量到数据库
				SET @insertsql = CONCAT('INSERT INTO ',devicecode,' (
																					device_code,
																					thing_code,
																					thing_avg,
																					thing_max,
																					thing_min,
																					thing_zsavg,
																					thing_zsmax,
																					thing_zsmin,
																					thing_cou,
																					update_type,
																					update_time,
																					begin_time,
																					end_time
																				)
																				VALUE
																				(
																					''',devicecode,''',
																					''a00000'',
																					''',@workflow,''',
																					''',@workflow,''',
																					''',@workflow,''',
																					''',@standardflow,''',
																					''',@standardflow,''',
																					''',@standardflow,''',
																					''',@standardflow,''',
																					''2061'',
																					''',@nowtime,''',
																					''',@begintime,''',
																					''',@endtime,'''
																				)');
				PREPARE stmt_insert FROM @insertsql;
				EXECUTE stmt_insert;
				DEALLOCATE PREPARE stmt_insert;
			-- SELECT @insertsql;
			END IF;
		FETCH NEXT FROM _device INTO devicecode;
		UNTIL done END REPEAT;
		IF TIMESTAMPDIFF(SECOND,@endtime,@nowtime)>0 THEN
			UPDATE tbl_sys_flag SET sys_value = @endtime,opt_time = @nowtime WHERE sys_flag_code='stahourflow'; 
		END IF;
	CLOSE _device;
	

END
;;
delimiter ;

-- ----------------------------
-- Procedure structure for prUpdateDeviceStatus
-- ----------------------------
DROP PROCEDURE IF EXISTS `prUpdateDeviceStatus`;
delimiter ;;
CREATE DEFINER=`root`@`%` PROCEDURE `prUpdateDeviceStatus`()
BEGIN
	#遍历标识
	DECLARE devicecode VARCHAR(100);
  -- 遍历数据结束标志
  DECLARE done INT DEFAULT FALSE;
  -- 设备状态编码
  DECLARE statuscode VARCHAR(100);
  -- 设备状态名称
  DECLARE statusname VARCHAR(200);
	-- 获取系统时间
	DECLARE nowtime DATETIME default NOW();
	-- 获取系统时间(0:无更新，1：有更新)
	DECLARE haveudp INT DEFAULT 0;

	DECLARE _device CURSOR FOR
		SELECT device_code FROM tbl_device WHERE device_type='1';

  -- 将结束标志绑定到游标
	DECLARE CONTINUE HANDLER FOR SQLEXCEPTION SET done = FALSE;
  DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;

	#创建临时表
	CREATE TEMPORARY TABLE IF NOT EXISTS tbm_thingcode
	(
		thing_code VARCHAR(100) NOT NULL,
		thing_value double(14,3) NULL,
		thing_max double(14,3) NOT NULL,
		thing_min double(14,3) NOT NULL,
		level_no int(2),
		data_flag int(11)
	) engine = MEMORY;
	TRUNCATE TABLE tbm_thingcode;

	OPEN _device;
		FETCH NEXT FROM _device INTO devicecode;
		REPEAT
				SET @deviceid = (SELECT device_id FROM tbl_device WHERE device_code = devicecode LIMIT 0,1);
				SET @orgstatuscode = (SELECT status_code FROM tbl_device WHERE device_id = @deviceid);
				IF STRCMP(@orgstatuscode,'N') = 0 OR STRCMP(@orgstatuscode,'NT') = 0 
						OR STRCMP(@orgstatuscode,'Z') = 0 OR STRCMP(@orgstatuscode,'O') = 0 THEN
					SET @newdatacount =	(SELECT COUNT(0)
																 FROM
																			tbl_device_time tdt
																	WHERE
																			tdt.device_code = devicecode
																		AND TIMESTAMPDIFF(SECOND,
																											(
																												SELECT
																													sys_value
																												FROM
																													tbl_sys_flag
																												WHERE
																													sys_flag_code = 'alarmupd'
																												LIMIT 0,1
																											),
																											tdt.update_time) >= 0
															);
					IF done = FALSE THEN
						SET @count_upload = (SELECT MIN(TIMESTAMPDIFF(SECOND, tdt.update_time,nowtime)) FROM tbl_device_time tdt WHERE tdt.device_code = devicecode);
						SET @exits = (SELECT COUNT(0) FROM tbl_device_time tdt WHERE tdt.device_code = devicecode AND tdt.update_time IS NOT NULL);
						SET @o_flag = FALSE;
						IF (@count_upload IS NOT NULL AND @count_upload>=1800 AND @exits>0) THEN
							SET @o_flag = TRUE;
						END IF;
						IF @newdatacount>0 OR @o_flag OR @exits=0 THEN
							-- 判断设备状态
							IF @o_flag THEN
								SET statuscode = 'O';
							ELSE IF @exits = 0 THEN
								SET statuscode = 'Z';
							ELSE
									-- 按实时上传数据判断是否超标（实时数据）
									SET @sqlsel1 = CONCAT('INSERT INTO tbm_thingcode(thing_code,thing_value,thing_max,thing_min,level_no,data_flag) 
																				SELECT tms.thing_code,tms.recent_data,tda.max_value,tda.min_value,tda.level_no,tda.data_flag FROM tbl_device_data
																				AS tms INNER JOIN tbl_device_alarmset tda ON tms.device_code = tda.device_code AND tms.thing_code = tda.thing_code AND tda.device_code= ''',devicecode,''' AND tda.data_flag = 1 
																				WHERE tms.data_type=''2011''
																					AND (
																					tda.max_value > tms.recent_data
																					AND tda.min_value <= tms.recent_data
																					)
																					GROUP BY tms.thing_code');
									PREPARE stmt_sel1 FROM @sqlsel1;
									EXECUTE stmt_sel1;
									DEALLOCATE PREPARE stmt_sel1;
									-- 按实时上传数据判断是否超标（折算数据）
									SET @sqlsel2 = CONCAT('INSERT INTO tbm_thingcode(thing_code,thing_value,thing_max,thing_min,level_no,data_flag) 
																				SELECT tms.thing_code,tms.recent_data,tda.max_value,tda.min_value,tda.level_no,tda.data_flag FROM tbl_device_data
																				AS tms INNER JOIN tbl_device_alarmset tda ON tms.device_code = tda.device_code AND tms.thing_code = tda.thing_code AND tda.device_code= ''',devicecode,''' AND tda.data_flag = 2 
																				WHERE tms.data_type=''2011''
																					AND (
																					tda.max_value > tms.recent_data
																					AND tda.min_value <= tms.recent_data
																					)
																					GROUP BY tms.thing_code');
									PREPARE stmt_sel2 FROM @sqlsel2;
									EXECUTE stmt_sel2;
									DEALLOCATE PREPARE stmt_sel2;
									SET @overcount = (SELECT COUNT(0) FROM tbm_thingcode);
									IF @overcount>0 THEN 
										SET statuscode = 'NT';
									ELSE
										SET statuscode = 'N';
									END IF;
								END IF;
							END IF;

							-- 获取设备状态名称
							SET statusname = (SELECT status_name FROM tbl_status WHERE status_code = statuscode);
							
							IF STRCMP(statuscode,'N') <> 0 THEN
								
								-- 最近报警时常
								-- SET @continuetime = IFNULL((SELECT TIMESTAMPDIFF(MINUTE,update_time,NOW()) FROM tbl_alarm WHERE device_code = devicecode AND alarm_type = 'NT' ORDER BY update_time DESC LIMIT 0,1),-1);
								-- 最大报警等级
								SET @maxlevel = (SELECT MAX(level_no) FROM tbm_thingcode);
								-- 原始报警等级
								SET @orglevel = (SELECT level_no FROM tbl_alarm WHERE device_code = devicecode AND alarm_type = 'NT' ORDER BY update_time DESC LIMIT 0,1);
								
								IF STRCMP(statuscode,@orgstatuscode) <> 0  THEN
									-- 插入报警数据
									IF statuscode = 'NT' THEN
											alarm_type,
											device_code,
											alarm_info,
											alarm_action,
											action_user,
											alarm_status,
											alarm_time,
											action_time,
											update_time,
											thing_code,
											up_value,
											low_value,
											thing_value,
											data_flag,
											level_no
										)
										SELECT 
											statuscode,
											devicecode,
											statusname,
											NULL,
											NULL,
											'1',
											nowtime,
											NULL,
											nowtime,
											thing_code,
											thing_max,
											thing_min,
											thing_value,
											data_flag,
											level_no
										FROM tbm_thingcode;
									ELSE
											alarm_type,
											device_code,
											alarm_info,
											alarm_action,
											action_user,
											alarm_status,
											alarm_time,
											action_time,
											update_time
										)
										VALUES
											(
												statuscode,
												devicecode,
												statusname,
												NULL,
												NULL,
												'1',
												nowtime,
												NULL,
												nowtime
											);
										END IF;
								ELSEIF STRCMP(@maxlevel,@orglevel)<>0 THEN
											alarm_type,
											device_code,
											alarm_info,
											alarm_action,
											action_user,
											alarm_status,
											alarm_time,
											action_time,
											update_time,
											thing_code,
											up_value,
											low_value,
											thing_value,
											data_flag,
											level_no
										)
										SELECT 
											statuscode,
											devicecode,
											statusname,
											NULL,
											NULL,
											'1',
											nowtime,
											NULL,
											nowtime,
											thing_code,
											thing_max,
											thing_min,
											thing_value,
											data_flag,
											level_no
										FROM tbm_thingcode;
								END IF;
							END IF;
							IF STRCMP(statuscode,@orgstatuscode) <> 0 THEN
								UPDATE tbl_device
									 SET status_code = statuscode
								 WHERE
											 device_id = @deviceid;
									 -- AND status_code IN ('N','Z','NT','O');
								SET haveudp = 1;
							END IF;
						TRUNCATE TABLE tbm_thingcode;
						END IF;
					END IF;
				END IF;
			FETCH NEXT FROM _device INTO devicecode;		
			UNTIL done END REPEAT;
	CLOSE _device;
	-- 更新时间
	IF (SELECT COUNT(0) FROM tbl_sys_flag WHERE sys_flag_code = 'alarmupd')>0 THEN
		IF  haveudp=1 THEN
		UPDATE tbl_sys_flag
			 SET sys_value = SUBDATE(nowtime,interval 30 second),opt_time=nowtime
		 WHERE sys_flag_code = 'alarmupd';
		END IF;
	ELSE
				sys_flag_code,
				sys_value,
				opt_time
			)
		VALUES
			(
				'alarmupd',
				nowtime,
				nowtime
			);
	END IF;
END
;;
delimiter ;

-- ----------------------------
-- Procedure structure for prUpdateEffectiveOnlineRateData
-- ----------------------------
DROP PROCEDURE IF EXISTS `prUpdateEffectiveOnlineRateData`;
delimiter ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `prUpdateEffectiveOnlineRateData`()
BEGIN
	#遍历标识
	DECLARE devicecode VARCHAR(100);
  -- 遍历数据结束标志
  DECLARE done INT DEFAULT FALSE;

	DECLARE erate DOUBLE(14,3) DEFAULT 0;
	DECLARE orate DOUBLE(14,3) DEFAULT 0;

	-- 定义游标
	DECLARE _device CURSOR FOR
		SELECT DISTINCT td.device_code FROM tbl_device td WHERE td.device_type = '1';

	-- 将结束标志绑定到游标
	DECLARE CONTINUE HANDLER FOR SQLEXCEPTION SET done = FALSE;-- FALSE
  DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;-- TRUE

	-- 设置时间
	SET @updtime = (SELECT sys_value FROM tbl_sys_flag WHERE sys_flag_code='eoupd' LIMIT 0,1);
	SET @nowtime = NOW();
	
	IF TIMESTAMPDIFF(SECOND,@updtime,@nowtime)>0 THEN
		SET @updateitemtime = TIMESTAMPADD(HOUR,-1,@updtime);
		OPEN _device;
			FETCH NEXT FROM _device INTO devicecode;
			REPEAT
				BEGIN
					IF done = FALSE THEN
						SET erate = 0;
						SET orate = 0;
						SET @einfo = NULL;
						SET @oinfo = NULL;
						-- 有效率
						SET @ercount = (SELECT COUNT(0) 
															FROM tbl_effective_rate 
														 WHERE device_code = devicecode 
															 AND DATE(effective_time) = DATE(@updateitemtime)
															 AND HOUR(effective_time) = HOUR(@updateitemtime));
						IF @ercount IS NULL OR @ercount = 0 THEN
							-- 有效个数
							SET @selectnersql = CONCAT('SET @nercount =
																							(SELECT
																									COUNT(DISTINCT rtd_time,thing_code)
																								FROM
																									',devicecode,'
																								WHERE
																									update_type = ''2011''
																								AND DATE(rtd_time) = DATE(''',@updateitemtime,''')
																								AND HOUR (rtd_time) = HOUR (''',@updateitemtime,''')
																								AND thing_flag = ''N'')');
							PREPARE stmt_ner_normal FROM @selectnersql;
							EXECUTE stmt_ner_normal;
							DEALLOCATE PREPARE stmt_ner_normal;
							-- 总个数
							SET @selectaersql = CONCAT('SET @aercount =
																							(SELECT
																									COUNT(DISTINCT rtd_time,thing_code)
																								FROM
																									',devicecode,'
																								WHERE
																									update_type = ''2011''
																								AND DATE(rtd_time) = DATE(''',@updateitemtime,''')
																								AND HOUR(rtd_time) = HOUR(''',@updateitemtime,'''))');
							PREPARE stmt_aer_normal FROM @selectaersql;
							EXECUTE stmt_aer_normal;
							DEALLOCATE PREPARE stmt_aer_normal;
							SET erate = (SELECT CASE WHEN @nercount IS NULL OR @aercount IS NULL OR @aercount = 0 THEN 0 ELSE (@nercount/@aercount) END);
							IF erate>1 THEN
								SET erate = 1;
								SET @einfo = '存在重复发送数据';
							END IF;
								device_code,
								effective_time,
								effective_rate,
								effective_info,
								all_count,
								er_count
							)VALUES(
								devicecode,
								CONCAT(DATE(@updateitemtime),' ',HOUR(@updateitemtime),':00:00'),
								erate,
								@einfo,
								CASE WHEN @aercount IS NULL THEN 0 ELSE @aercount END,
								CASE WHEN @nercount IS NULL THEN 0 ELSE @nercount END
							);
						END IF;
						-- 在线率
						SET @orallcount = (SELECT hour_count FROM tbl_device WHERE device_code=devicecode LIMIT 0,1);
						IF @orallcount IS NULL THEN
							SET @orallcount = 60;
						END IF;
						SET @orcount = (SELECT COUNT(0) 
															FROM tbl_online_rate 
														 WHERE device_code = devicecode 
															 AND DATE(online_time) = DATE(@updateitemtime)
															 AND HOUR(online_time) = HOUR(@updateitemtime));
						IF @orcount IS NULL OR @orcount = 0 THEN
							-- 上传个数
							SET @selectnorsql = CONCAT('SET @norcount =
																							(SELECT
																									COUNT(DISTINCT rtd_time)
																								FROM
																									',devicecode,'
																								WHERE
																									update_type = ''2011''
																								AND DATE(rtd_time) = DATE(''',@updateitemtime,''')
																								AND HOUR(rtd_time) = HOUR(''',@updateitemtime,'''))');
							PREPARE stmt_nor_normal FROM @selectnorsql;
							EXECUTE stmt_nor_normal;
							DEALLOCATE PREPARE stmt_nor_normal;
							SET orate = (SELECT CASE WHEN @norcount IS NULL THEN 0 ELSE @norcount/@orallcount END);
							IF orate>1 THEN
								SET orate = 1;
								SET @oinfo = '存在重复发送数据';
							END IF;
								device_code,
								online_time,
								online_rate,
								online_info,
								all_count,
								or_count
							)VALUES(
								devicecode,
								CONCAT(DATE(@updateitemtime),' ',HOUR(@updateitemtime),':00:00'),
								orate,
								@oinfo,
								@orallcount,
								CASE WHEN @norcount IS NULL THEN 0 ELSE @norcount END
							);
						END IF;
						-- 失控数据报警
						-- SELECT erate*orate;
				END IF;
			END;
		FETCH NEXT FROM _device INTO devicecode;		
		UNTIL done END REPEAT;
		CLOSE _device;
		UPDATE tbl_sys_flag SET sys_value = TIMESTAMPADD(HOUR,1,@updtime),opt_time = @nowtime WHERE sys_flag_code='eoupd'; 	
	END IF;
END
;;
delimiter ;

-- ----------------------------
-- Procedure structure for prUpdateThermData
-- ----------------------------
DROP PROCEDURE IF EXISTS `prUpdateThermData`;
delimiter ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `prUpdateThermData`()
BEGIN
	#遍历标识
	DECLARE devicecode VARCHAR(100);
  -- 遍历数据结束标志
  DECLARE done INT DEFAULT FALSE;


	#Routine body goes here...
	DECLARE _device CURSOR FOR
		(SELECT DISTINCT td.device_code FROM tbl_device td 
		INNER JOIN tbl_device_time tdt ON td.device_code = tdt.device_code 
		WHERE TIMESTAMPDIFF(SECOND,
												(SELECT sys_value FROM tbl_sys_flag WHERE sys_flag_code='thermupd' LIMIT 0,1),
												tdt.update_time)>=0
		AND td.device_type = '1');

	-- 将结束标志绑定到游标
	DECLARE CONTINUE HANDLER FOR SQLEXCEPTION SET done = FALSE;-- FALSE
  DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;-- TRUE

	-- 设置时间
	SET @updtime = (SELECT sys_value FROM tbl_sys_flag WHERE sys_flag_code='thermupd' LIMIT 0,1);
	SET @nowtime = NOW();
	

	OPEN _device;
		FETCH NEXT FROM _device INTO devicecode;
		REPEAT
			BEGIN
				IF done = FALSE AND TIMESTAMPDIFF(SECOND,@updtime,@nowtime)>0 THEN
					SET @insertsql  = CONCAT('INSERT INTO tbl_therm_data (
																									device_code,
																									thing_code,
																									data_type,
																									data_time,
																									data_value)
																			SELECT 
																					device_code,
																					thing_code,
																					update_type,
																					begin_time,
																					thing_avg 
																			FROM ',devicecode,' 
																			WHERE TIMESTAMPDIFF(SECOND,''',@updtime,''',update_time)>0 AND update_type IN (''2031'',''2061'')');
					PREPARE stmt_insert FROM @insertsql;
					EXECUTE stmt_insert;
					DEALLOCATE PREPARE stmt_insert;
					SET @deletesql = CONCAT('DELETE FROM tbl_therm_data WHERE TIMESTAMPDIFF(SECOND,data_time,''',@nowtime,''')>=3*30*24*3600');
					PREPARE stmt_delete FROM @deletesql;
					EXECUTE stmt_delete;
					DEALLOCATE PREPARE stmt_delete;
				END IF;
			END;
		FETCH NEXT FROM _device INTO devicecode;		
		UNTIL done END REPEAT;
	CLOSE _device;

	UPDATE tbl_sys_flag SET sys_value = @nowtime,opt_time = @nowtime WHERE sys_flag_code='thermupd'; 
	
END
;;
delimiter ;

